import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';
import RoutersApp from './RoutersApp'; // Assuming RoutersApp is the file where you defined your routing configuration

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <RoutersApp />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
